import React from 'react'
import './about.css'
const AboutUs = () => {
  return (
    <div className='about'>
      <h1>ABOUT US</h1>
      <p>
      GET YOUR FITNESS <br /> BRAND TO THE DIGITAL <br /> WORLD. <br /> TOGETHER WE CREATE,<br /> WE DESIGN, WE FIT.
      </p>
    </div>
  )
}

export default AboutUs
